  `account_ruble` VARCHAR(40) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'счет в рублях',
  `account_euro` VARCHAR(40) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'счет в евро',
  `deleted` TINYINT(1) UNSIGNED NOT NULL DEFAULT '0',
