  CONSTRAINT `organization_city_official_fk` FOREIGN KEY (`city_official_id`) REFERENCES `city` (`id`),
  CONSTRAINT `organization_fk` FOREIGN KEY (`region_id`) REFERENCES `region` (`id`),
  CONSTRAINT `organization_industry_fk` FOREIGN KEY (`industry_id`) REFERENCES `industry` (`id`),
  CONSTRAINT `organization_type_ownership_fk` FOREIGN KEY (`type_ownership_id`) REFERENCES `type_ownership` (`id`),
